-- PostgreSQL plain SQL dump for Kawa Market sales dataset
BEGIN;

DROP TABLE IF EXISTS public.kawa_ventes;
CREATE TABLE public.kawa_ventes (
    id_vente INTEGER PRIMARY KEY,
    date_vente TEXT,
    magasin_code TEXT,
    magasin_nom TEXT,
    categorie_produit TEXT,
    produit_nom TEXT,
    mode_paiement TEXT,
    quantite INTEGER,
    prix_unitaire NUMERIC(10,2),
    cout_unitaire NUMERIC(10,2),
    remise_pct INTEGER,
    client_type TEXT,
    vendeur_id TEXT
);


COMMIT;
